import * as React from "react";
import Button from "@mui/material/Button";

export default function DisplayItem(props) {
  const item = props.item;
  return (
    <div>
      <h2 className="Name">{item.name} Tea</h2>
      <p className="Description">
        {item.name} tea has <b>{item.caffeine}mg</b> of caffeine.{" "}
        {item.description}
      </p>
      <div className="PriceBlock">
        <h3>{item.price}$</h3>
        <Button variant="contained" color="secondary" onClick={item.onClick}>
          Add to Cart!
        </Button>
        <p className="ProductNumber">product num: {props.id}</p>
      </div>
      <img className="Image" src={item.image} alt="{item.name}" />
    </div>
  );
}
